Troubleshooting Tailwind CSS classNames in Next.js<p>I'm working on a Next.js project and using Tailwind CSS for styling. However, I'm encountering an error related to classNames in my <code>page.js</code> file. I've checked my import statements, but the error persists. Can anyone help me identify what might be causing this issue and how to resolve it?</p>
<p><strong>Code snippet:</strong></p>
<pre class="lang-js prettyprint-override"><code>import Link from &quot;next/link&quot;;

const getSeries = async() =&gt; {
    try {
      const res = await fetch('http://localhost:3000/api', {cache: &quot;no-store&quot;});
      if (!res.ok) {
        throw new Error(&quot;Fetching failed&quot;);
      };
      return res.json();
    } catch (error) {
      console.error(&quot;Series Collection: c%FAILED&quot;,&quot;color:red&quot;,error);
    }
  } 


export default async function Series() {
    const {series} = await getSeries();

    return (
        &lt;main&gt;
            {series?.map((serie) =&gt; {
                return (
                    &lt;div className=&quot;flex flex-col&quot;&gt;
                    &lt;div className=&quot;flex justify-between&quot;&gt;
                    &lt;div&gt;
                        &lt;div className=&quot;flex flex-col justify-start&quot;&gt;
                        &lt;h1 className=&quot;text-white font-extrabold pt-2 px-2 mt-2 mx-2&quot;&gt;{serie.name}&lt;/h1&gt;
                        &lt;div className=&quot;flex justify-between pb-2 px-2 mt-2 mx-2&quot;&gt;
                            &lt;p className=&quot;text-orange-300 md:star_gradient font-extrabold&quot;&gt;{serie.author}&lt;/p&gt;
                            &lt;p className=&quot;opacity-80 text-white font-extrabold &quot;&gt;{serie.rate}&lt;/p&gt;
                        &lt;/div&gt;
                        &lt;/div&gt;
                    &lt;/div&gt;
                    &lt;Link href={`@/app/${serie}`} className=&quot;rounded opacity-80 bg-blue-500 text-center p-2 m-2 text-white font-extrabold shadow-sm&quot;&gt;
                        See More
                    &lt;/Link&gt; 
                    &lt;/div&gt;
                    &lt;div className=&quot;flex carousel&quot;&gt;
                      {serie.episodes?.map((episode) =&gt; {
                        &lt;Link className={`bg-gradient-to-b from-[url(&quot;${episode.thumbnail}&quot;)] to-black flex align-end justify-end p-2 m-2 h-[300px] w-[640px] rounded shadow-md`} href={`@/app/${serie}/${episode.id}`}&gt;
                        &lt;h1&gt;{episode?.name}&lt;/h1&gt;
                        &lt;/Link&gt;
                      })}
                    &lt;/div&gt;
                &lt;/div&gt;
            )})}
        &lt;/main&gt;
  )
} 
</code></pre>
<p><strong>Error Message:</strong></p>
<pre><code>./app/globals.css:4:0
Module not found: Can't resolve './{'

https://nextjs.org/docs/messages/module-not-found

Import trace for requested module:
./app/globals.css
</code></pre>
<p>I suspect the issue might be related to the classNames in the <code>page.js</code> file, even though my import statements seem correct. Any guidance on debugging and resolving this would be greatly appreciated.</p>
<p><em>Note: I need the image to be there since is a great part of my UI</em></p>

