<p>How can I aggregate, filter nested array and project selected nested fields?</p>
<p>I have the following data:</p>
<pre class="lang-js prettyprint-override"><code>{
  &quot;teacher&quot;: &quot;Ben&quot;,
  &quot;students&quot;: [
    {
      &quot;name&quot;: &quot;Liz&quot;,
