mongoose complains about duplicate id<p>For brief context, I'm creating a web app using ReactJS, Node.js + mongoDB. It's purpose is to hold lists of meals and products, and from them you can easily create shopping lists.</p>
<p>I'm totally inexperienced with Node.js and MongoDB and learning along the way of creating this app, therefore I need your help to solve an issue.</p>
<p>productSchema in mongoose looks like this:</p>
<pre><code>{
  uniqueId: {
    type: String,
    required: true,
    default: () =&gt; nanoid(),
    index: { unique: true },
  },
  productName: {
    type: String,
    required: true,
  },
}
</code></pre>
<p>mealSchema:</p>
<pre><code>{
  uniqueId: {
    type: String,
    required: true,
    default: () =&gt; nanoid(),
    index: { unique: true },
  },
  mealName: {
    type: String,
    required: true,
    trim: true,
  },
  products: [
    {
      uniqueId: {
        type: String,
        required: true,
        default: () =&gt; nanoid(),
        index: { unique: true },
      },
      productName: { type: String, ref: productSchema },
      productAmount: Number,
    },
  ],
}
</code></pre>
<p>as you can see, the products array in mealSchema is pretty much the same as Product[] but having an extra property of productAmount.</p>
<p>The logic in frontend is that when you create a new Meal, you can add as much products as you want (either select from list of Products (which is retrieved from DB) or create new ones). Then the whole Meal is sent to backend, Meal is created in MongoDB collection and after that, BE also iterates through every product, and if it doesn't exist in the 'products' collection, it is also added there.</p>
<p>I'm having an issue that when I'm trying to create a Meal and add a Product which already exists in the 'products' collection, backend returns me an error:</p>
<pre><code>{
  &quot;error&quot;: &quot;Could not create meal&quot;,
  &quot;message&quot;: &quot;E11000 duplicate key error collection: test.meals index: products.uniqueId_1 dup key: { products.uniqueId: \&quot;ukmLU8nDtIXaBA7OzZD6R\&quot; }&quot;
}
</code></pre>
<p>Can somebody please help me solve this?</p>

