let handleSaveItem = () =&gt; {
        const newItemData = { productName, sellingPriceOfTotal, quantityCount, unitOfQuantity, sellingPrice };
        setNewItems([...newItems, newItemData]); 
    }

let handleSaveMonyIn = (event) =&gt; {
        event.preventDefault();
        if (totalAmountIn === 0 || itemDescription === &quot;&quot;) {
            setSeverity(&quot;error&quot;)
            setMessage(&quot;Enter Amount and Item Description&quot;);
            setOpen(true)
        } else if (totalSellingPrice &gt; totalAmountIn) {
            setSeverity(&quot;error&quot;)
            setMessage(&quot;Total Selling Prices cannot be bigger than Total amount&quot;);
            setOpen(true)
        }

        else {
            const newMoneyInData = { totalAmountIn, amountRecieved, balanceDue, itemDescription, modeOfPayment };
            setMoneyInData([...moneyInData, newMoneyInData]);

            //Save in the database
            Axios.post('http://localhost:3500/moneyIn',{
                totalAmountIn, amountRecieved, balanceDue, newItems, itemDescription, modeOfPayment
            }).then((response) =&gt; {alert('TRANSACTION CREATED')}).catch(function (error) {
                console.log(error);
              });
            Axios.post('http://localhost:3500/newItems', {productName, sellingPriceOfTotal, quantityCount, unitOfQuantity, 
            sellingPrice,totalSellingPrice}).then((response) =&gt; console.log(response)).catch((err)=&gt; console.log(err));
            console.log(newMoneyInData);
            document.getElementById(&quot;totalAndRecievedAmt&quot;).reset();
            document.getElementById(&quot;itemDescriptionFrm&quot;).reset();
            setSeverity(&quot;success&quot;);
            setMessage(&quot;Saved Successfully !!!&quot;);
            setOpen(true);
             setTotalAmountIn(0);
             setAmountRecieved(0);
             setBalanceDue(0);
             setItemDescription('');
             setNewItems([]);


        }
    }

}

