const getAllNewItems = asyncHandler(async (req, res) =&gt; {

    const newItemsData = await NewItemsData.find().populate('sales').select().lean()

    if (!newItemsData?.length) {
        return res.status(400).json({ message: 'No rescent transaction' })
    }
    res.json(newItemsData)
})

const createNewItems = asyncHandler(async (req, res) =&gt; {

    const { productName, sellingPriceOfTotal, quantityCount, unitOfQuantity, sellingPrice}= req.body

    //confirm data
    if (!productName || !sellingPriceOfTotal || !quantityCount
        || !unitOfQuantity || !sellingPrice ) {

        return res.status(400).json({ message: 'All fields are required' })
    }

