{
    &quot;_id&quot; : &quot;image/jpeg&quot;,
    &quot;count&quot; : 8.0
}
</code></pre>
<p>I try this way:</p>
<pre class="lang-scala prettyprint-override"><code>def contentTypeStats(implicit ec: ExecutionContext): Future[ContentTypesDTO] = {
    collectionFactory.collection().flatMap(collection =&gt; {

      import collection.AggregationFramework._
