    })
  }
</code></pre>
<p>That method return <code>None</code> when ask for the <code>_id</code> and the count field give randomly some of the previous results (5, 8, 9), it should be a way to access the specific count field of each <code>_id</code> that should be either <code>image/png</code> or <code>image/jpeg</code> or <code>application/pdf</code> but how if I can get the <code>_id</code></p>

